import React from 'react';
import './App.css';
import Buttons from './Buttons';

function App() {
  return (
    <div className="App">
      <div className="borda-exterior">
        <div className="borda-inferior">
          <Buttons />
        </div>
      </div>
    </div>
  );
}

export default App;
